import React from 'react';
import { useNavigate } from 'react-router-dom';
import ReturnRemoveClienT from './Client';
import FadeLoader from 'react-spinners/FadeLoader';

// Remove Main
export default function ClientRemOve() {

 const navigation = useNavigate();
 React.useEffect(() => {

  JSON.parse(window.localStorage.getItem('ACTIVE')) !== true && navigation('/');
  window.setTimeout(() => {
   setLoading(false);
  }, 7600);


 }, []);

 return (
  <div>
   {loading && <div className='App-loading-Actif'></div>}
   {loading && <div className='App-Icon'>
    <FadeLoader
     size={15}
     color={'#00b8d4'}
     loading={loading}
    />
   </div>}

   <ReturnRemoveClienT />
  </div>
 )
};
